import React from "react";

const ControlPanel = ({
  videoStream,
  isVideoConnected,
  videoUrl,
  isConnected,
  handleMouseDown,
  handleMouseUp,
  handleTouchStart,
  handleTouchEnd,
  handleStopClick,
}) => {
  return (
    <div className="min-h-screen bg-gray-100 flex flex-col md:flex-row justify-center items-start gap-6 p-6 font-sans">
      {/* ====== VIDEO SECTION ====== */}
      <div className="flex-1 bg-white rounded-2xl shadow-md p-4 flex flex-col items-center justify-center">
        <h2 className="text-lg font-semibold text-gray-700 mb-3 self-start">
          Live Camera Feed
        </h2>

        <div className="w-full h-[400px] flex items-center justify-center border border-gray-200 rounded-xl overflow-hidden bg-gray-50">
          {videoStream && isVideoConnected ? (
            <img
              src={videoStream}
              alt="Live Video Feed"
              className="w-full h-full object-cover"
            />
          ) : (
            <div className="flex flex-col items-center text-center text-gray-600 px-4">
              <div className="text-5xl mb-2">üìπ</div>
              <p className="font-medium">
                {isVideoConnected
                  ? "Connecting to video stream..."
                  : "Live video feed will appear here"}
              </p>
              <small className="text-gray-500 mt-1">
                {videoUrl
                  ? `Stream URL: ${videoUrl}`
                  : "Configure video stream URL in settings"}
              </small>

              {!isVideoConnected && videoUrl && (
                <div className="mt-3 flex items-center gap-2 text-sm text-red-500 font-medium">
                  <span className="w-2 h-2 bg-red-500 rounded-full animate-pulse"></span>
                  Video stream disconnected
                </div>
              )}
            </div>
          )}
        </div>
      </div>

      {/* ====== CONTROLLER SECTION ====== */}
      <div className="w-full md:w-[340px] bg-white rounded-2xl shadow-md p-6 flex flex-col items-center">
        <h2 className="text-xl font-semibold text-gray-800 mb-4">
          Vehicle Controls
        </h2>

        <div className="grid grid-cols-3 gap-4">
          {/* Row 1 */}
          <div></div>
          <button
            id="forward"
            onMouseDown={() => handleMouseDown("forward")}
            onMouseUp={() => handleMouseUp("forward")}
            onTouchStart={(e) => handleTouchStart(e, "forward")}
            onTouchEnd={(e) => handleTouchEnd(e, "forward")}
            disabled={!isConnected}
            className={`control-btn bg-blue-500 hover:bg-blue-600 text-white ${
              !isConnected && "opacity-50 cursor-not-allowed"
            }`}
          >
            ‚¨Ü
          </button>
          <div></div>

          {/* Row 2 */}
          <button
            id="left"
            onMouseDown={() => handleMouseDown("left")}
            onMouseUp={() => handleMouseUp("left")}
            onTouchStart={(e) => handleTouchStart(e, "left")}
            onTouchEnd={(e) => handleTouchEnd(e, "left")}
            disabled={!isConnected}
            className={`control-btn bg-blue-500 hover:bg-blue-600 text-white ${
              !isConnected && "opacity-50 cursor-not-allowed"
            }`}
          >
            ‚¨Ö
          </button>

          <button
            id="stop"
            onClick={handleStopClick}
            disabled={!isConnected}
            className={`control-btn bg-red-500 hover:bg-red-600 text-white font-semibold ${
              !isConnected && "opacity-50 cursor-not-allowed"
            }`}
          >
            ‚èπ
          </button>

          <button
            id="right"
            onMouseDown={() => handleMouseDown("right")}
            onMouseUp={() => handleMouseUp("right")}
            onTouchStart={(e) => handleTouchStart(e, "right")}
            onTouchEnd={(e) => handleTouchEnd(e, "right")}
            disabled={!isConnected}
            className={`control-btn bg-blue-500 hover:bg-blue-600 text-white ${
              !isConnected && "opacity-50 cursor-not-allowed"
            }`}
          >
            ‚û°
          </button>

          {/* Row 3 */}
          <div></div>
          <button
            id="backward"
            onMouseDown={() => handleMouseDown("backward")}
            onMouseUp={() => handleMouseUp("backward")}
            onTouchStart={(e) => handleTouchStart(e, "backward")}
            onTouchEnd={(e) => handleTouchEnd(e, "backward")}
            disabled={!isConnected}
            className={`control-btn bg-blue-500 hover:bg-blue-600 text-white ${
              !isConnected && "opacity-50 cursor-not-allowed"
            }`}
          >
            ‚¨á
          </button>
          <div></div>
        </div>

        {/* Connection Status */}
        <div className="mt-6 flex flex-col items-center gap-1">
          {isConnected ? (
            <div className="flex items-center gap-2 text-sm text-green-600 font-medium">
              <span className="w-2 h-2 bg-green-500 rounded-full animate-pulse"></span>
              Connected
            </div>
          ) : (
            <div className="flex items-center gap-2 text-sm text-yellow-600 font-medium">
              ‚ö†Ô∏è Vehicle not connected
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default ControlPanel;
